import React from 'react'
import FadeInOnScroll from '../../../components/FadeInOnScroll';
import ReactPlayer from 'react-player';
import { Player } from 'video-react';

function TeamVideoComponent() {
    return (
        <FadeInOnScroll>
        <div className='video-component'>
        {/* <ReactPlayer muted playing='true' loop='true' controls='false' className='react-player' url='https://www.https://www.youtube.com/watch?v=2_5tZgAUN6g&feature=youtu.be.com/watch?v=7sDY4m8KNLc'/> */}
        <Player
      playsInline
      poster="/assets/poster.png"
      src="https://media.w3.org/2010/05/sintel/trailer_hd.mp4"
    />
        </div>
         </FadeInOnScroll>
    )
}

export default TeamVideoComponent
